Passport Data type Your bot now receives a new message update with the encrypted Passport data. The user is also notified in the chat: Passport update Let's decrypt that gibberish to get the information. That's what DecryptPassportDataAsync method does. Step 1: Credentials EncryptedCredentials type Credentials type You can't just access the encrypted data in the message.passport_data.data array. Required parameters for their decryption are in the message.passport_data.credentials object. But that credentials object is encrypted using bot's public key! We first take the bot's private key this time and decrypt the credentials. There are more details about importing a key in PEM format on the RSA Key page . IDecrypter decrypter = new Decrypter();
Credentials credentials = decrypter.DecryptCredentials( message.PassportData.Credentials, // EncryptedCredentials object GetRsaPrivateKey() // private key as an RSA object
); Step 2: Nonce Credentials type Request Parameters type There is a nonce property on the credentials (now decrypted) object. In order to prevent certain attacks, ensure its value is exactly the same as the nonce you set in the authorization request. Read more about nonce on Wikipedia . Step 3: Residential Address EncryptedPassportElement type ResidentialAddress type SecureData type SecureValue type DataCredentials type It's finally time to see the user's address. We are looking for an encrypted element with type of address in message.passport_data.data array. Also, decryption parameters for that are in credentials.secure_data.address.data. Here is how the decryption magic happens: EncryptedPassportElement addressElement = message.PassportData.Data.Single( el => el.Type == PassportEnums.Scope.Address
);
ResidentialAddress address = decrypter.DecryptData<ResidentialAddress>( encryptedData: addressElement.Data, dataCredentials: credentials.SecureData.Address.Data
); DecryptData method does 3 tasks here: Decrypts the data into a JSON-serialized string Verifies that the data hashes match Converts from JSON to a .NET object Step 4: Phone Number EncryptedPassportElement type Values for phone number and email address are not end-to-end encrypted in Telegram Passport and Telegram stores these values after being verified. There is no need for decryption at this point. Just find the element with the type of phone_number in the message.passport_data.data array.

